import * as ReactDOM from 'react-dom';
import * as React from 'react';
import { useEffect, useRef, useState } from 'react';
import { DialogComponent } from '@syncfusion/ej2-react-popups';
import { ButtonComponent } from '@syncfusion/ej2-react-buttons';
import './index.css';
import { PdfViewerComponent, Toolbar, Magnification, Navigation, LinkAnnotation, BookmarkView, ThumbnailView, Print, TextSelection, Annotation, TextSearch, FormFields, FormDesigner, PageOrganizer, Inject } from '@syncfusion/ej2-react-pdfviewer';

export function App() {
  const [isDialogOpen, setDialogOpen] = useState(false);
  const viewerRef = React.useRef(null);
  let dialogInstance = useRef(null);
  var documentPath = window.location.origin + "/ej2-pdfviewer-lib/Loan Consolidation.pdf";
  var resource = window.location.origin + "/ej2-pdfviewer-lib";

 function openDialog() {
    setDialogOpen(true);
}
 function dialogOpen() {
    setDialogOpen(true);
    viewerRef.current.load("data:application/pdf;base64,", null)
    // viewerRef.current.documentPath = documentPath
}
 function dialogClose() {
        setDialogOpen(false);
    }
  return (
    <div>
      <ButtonComponent onClick={openDialog}>Open PDF Viewer</ButtonComponent>
         <DialogComponent id="defaultDialog" showCloseIcon={true} ref={dialogInstance} visible={isDialogOpen} minHeight={'90%'} width={'90%'} height={'90%'} isModal={true}  open={dialogOpen} close={dialogClose}>
            <div className='control-section'>
              <PdfViewerComponent
                ref={viewerRef}
                id="container"
                resourceUrl={resource}
                extractTextOption="None"
                enableLocalStorage={true}
                extractTextCompleted={extractTextCompleted}
                style={{ 'height': '640px' }}>
                <Inject services={[Toolbar, Magnification, Navigation, Annotation, LinkAnnotation, BookmarkView, ThumbnailView, Print, TextSelection, TextSearch, FormFields, FormDesigner, PageOrganizer]}/>
              </PdfViewerComponent>
            </div>
        </DialogComponent>
    </div>
  );
}
const extractTextCompleted = (args) => {
  console.log(args);
};
const root = ReactDOM.createRoot(document.getElementById('sample'));
root.render(<App />);